import React, { useState } from "react";

const Search2 = () => {
  const [img, setImg] = useState("");

  const handleInput = (e) => {
    const data = e.target.value;
    setImg(data);
  };

  return (
    <div>
      <input
        type="text"
        placeholder="find your place image"
        onChange={handleInput}
      ></input>
    </div>
  );
};

